function SendColors(shutdown = false){

	let RGBData = new Array(586).fill(0);
	let TotalLedCount = 0;

	for(let iIdx = 0; iIdx < vKeymap.length; iIdx++) {
		let iPxX = vLedPositions[iIdx][0];
		let iPxY = vLedPositions[iIdx][1];
		var color;

		if(shutdown){
			color = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			color = hexToRgb(forcedColor);
		}else{
			color = device.color(iPxX, iPxY);
		}

		RGBData[vKeymap[iIdx]*3] = color[0];
		RGBData[vKeymap[iIdx]*3+1] = color[1];
		RGBData[vKeymap[iIdx]*3+2] = color[2];
		TotalLedCount += 1;
	}

	let sentLeds = 0;
	let PacketCount = 0;

	for(let i = 0; i < Object.keys(RowDict).length ;i++){

		let LedsToSend = RowDict[PacketCount];

		let packet = [];
		packet[0] = 0x00;
		packet[1] = 0x00;
		packet[2] = 0x1F;
		packet[3] = 0x00;
		packet[4] = 0x00;
		packet[5] = 0x00;
		packet[6] = 0x47;
		packet[7] = 0x0F;
		packet[8] = 0x03;
		packet[11] = PacketCount++;
		packet[13] = 0x15;
		packet = packet.concat(RGBData.splice(0, LedsToSend*3));

		device.send_report(packet, 91);
		//device.pause(1);
	}
}

function GetReport(cmd_class, cmd_id, size) {
	let report = new Array(91).fill(0);

	report[0] = 0;

	// Status.
	report[1] = 0x00;

	// Transaction ID.
	report[2] = 0xFF;

	// Remaining packets.
	report[3] = 0x00;
	report[4] = 0x00;

	// Protocol type.
	report[5] = 0x00;

	// Data size.
	report[6] = size;

	// Command class.
	report[7] = cmd_class;

	// Command id.
	report[8] = cmd_id;

	//report[8-87] = data;

	//report[89] = crc;

	//report[89] = reserved;

	return report;
}

function CalculateCrc(report) {
	let iCrc = 0;

	for (let iIdx = 3; iIdx < 89; iIdx++) {
		iCrc ^= report[iIdx];
	}

	return iCrc;
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}
